import Layout from "../components/layout/layout";
import User from "../icons/user";

function Dashboard() {
  const position = { topbar: "flex gap-5" };
  const design = {
    topbar: "font-medium *:cursor-pointer",
    active: "text-gray-500",
  };

  function isActive(e) {
    const siblings = e.target.parentNode.children;
    [...siblings].forEach((sibling) => sibling.classList.remove(design.active));
    e.target.classList.add(design.active);
  }

  return (
    <Layout>
      <div className={`${position.topbar} ${design.topbar}`}>
        <p className={design.active} onClick={(e) => isActive(e)}>
          Profile
        </p>
        <p onClick={(e) => isActive(e)}>Inbox</p>
        <p onClick={(e) => isActive(e)}>Orders</p>
        <p onClick={(e) => isActive(e)}>Favourites</p>
        <p onClick={(e) => isActive(e)}>Settings</p>
      </div>
      <div>
        <Profile />
      </div>
    </Layout>
  );
}

export default Dashboard;

function Profile() {
  const position = {
    container: "flex flex-col gap-2 justify-center items-center my-20",
    image: "flex items-center justify-center w-28 h-28 ",
  };
  const design = {
    heading: "text-4xl",
    text: "text-gray-500",
    image: "bg-gray-200 rounded-full",
  };
  const user = JSON.parse(sessionStorage.getItem("user"));
  const date = new Date().toLocaleString("en-US", {
    month: "long",
    year: "numeric",
  });

  return (
    <div className={position.container}>
      <div className={`${position.image} ${design.image}`}>
        <User />
      </div>
      <h3 className={design.heading}>
        {user[0].fname} {user[0].lname}
      </h3>
      <p className={design.text}>Member Since {date}</p>
    </div>
  );
}
